import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
        <img src='https://image.freepik.com/free-vector/closeup-fountain-pen-writing-signature-realistic_1284-13522.jpg' alt='logo' />
        <h1>Green Notes</h1>
        <p>We in Green Notes bilieve that all deserve to have access to a note taking software which will allow them to organize and navigate during theese trying times. We all will work together and build such a software , That is our team culture! </p>
      </div>
    </div>
  );
}
